// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract HelloWorld {

  uint256 public interest;

  mapping (address => uint) public investors;

  mapping (address => uint) public borrowers;

  address public owner;		//  

  function hi() public pure returns (string memory) {
        return ("Hello World");
  }

  constructor(address adminAddr){
    interest = 1; // sol is not support float type yet.

    owner = adminAddr;
  }

  function makeDeposit() payable public {
    uint deposit = msg.value;
    if(!payable(owner).send(deposit)) {
			revert();
		}
    investors[msg.sender] += deposit;
  }

  function borrow(uint amount) payable public{
    if(!payable(msg.sender).send(amount)) {
			revert();
		}
    borrowers[msg.sender] += amount;
  }
}
